ஒரு செவ்வக மைதானம், கீழே காட்டப்பட்டுள்ளபடி, ஒரு விளையாட்டு பந்தயப் பாதையில் மூடப்பட்டுள்ளது. பந்தயப் பாதை மைதானத்தின் இரண்டு விளிம்புகளையும், இரண்டு அரை வட்டங்களையும் கொண்டுள்ளது. பந்தயப் பாதையின் நீளம் 400 மீட்டர்கள். மைதானத்தின் மிகப்பெரிய சாத்தியமான பரப்பளவு என்ன, சதுர மீட்டர்களில்?

[asy]
unitsize(1 cm);

filldraw((0,0)--(3,0)--(3,2)--(0,2)--cycle,lightgreen);
draw((0,0)--(3,0),linewidth(2*bp));
draw((0,2)--(3,2),linewidth(2*bp));
draw(arc((3,1),1,-90,90),linewidth(2*bp));
draw(arc((0,1),1,90,270),linewidth(2*bp));
[/asy]

